import React from "react";
import { StyleSheet, Text, View } from "react-native";

function ViewScreen({ route }) {
  const { data } = route.params;

  return (
    <View>
      <Text>Lista de Items, Prueba</Text>
    </View>
  );
}

export default ViewScreen;
